{"id": "0898-ventilator", "word": "ventilator", "tweet1": {"text": "More on my brother's condition--he stays on the ventilator today, off it tomorrow, &amp; in ICU through Sunday. To the many #Christian brothers &amp; sisters who #prayed for Norman, thank you again! I love you! (Prayers for long-term recovery would be appreciated.) Glory to our God!", "tokens": ["More", "on", "my", "brother's", "condition--he", "stays", "on", "the", "ventilator", "today", ",", "off", "it", "tomorrow", ",", "&", "in", "ICU", "through", "Sunday", ".", "To", "the", "many", "#Christian", "brothers", "&", "sisters", "who", "#prayed", "for", "Norman", ",", "thank", "you", "again", "!", "I", "love", "you", "!", "(", "Prayers", "for", "long-term", "recovery", "would", "be", "appreciated", ".", ")", "Glory", "to", "our", "God", "!"], "token_idx": 8, "text_start": 48, "text_end": 58, "date": "2019-03"}, "tweet2": {"text": "My parents tested negative for COVID today. ðŸ™ðŸ¼ My mom works at a nursing home and one of the patients is positive. Another nurse my mom works with is on a ventilator now. Just hoping for the best. It's all so scary.", "tokens": ["My", "parents", "tested", "negative", "for", "COVID", "today", ".", "ðŸ™ðŸ¼", "My", "mom", "works", "at", "a", "nursing", "home", "and", "one", "of", "the", "patients", "is", "positive", ".", "Another", "nurse", "my", "mom", "works", "with", "is", "on", "a", "ventilator", "now", ".", "Just", "hoping", "for", "the", "best", ".", "It's", "all", "so", "scary", "."], "token_idx": 33, "text_start": 155, "text_end": 165, "date": "2020-03"}}
{"id": "0899-ventilator", "word": "ventilator", "tweet1": {"text": "Only 10% of the references from the surviving sepsis guidelines emanate from low resource settings. Applying these guidelines have resulted in increased mortality in some settings. You hydrate generously but have no ventilator if the patient congests. Eye opening. #ECCMID2019", "tokens": ["Only", "10", "%", "of", "the", "references", "from", "the", "surviving", "sepsis", "guidelines", "emanate", "from", "low", "resource", "settings", ".", "Applying", "these", "guidelines", "have", "resulted", "in", "increased", "mortality", "in", "some", "settings", ".", "You", "hydrate", "generously", "but", "have", "no", "ventilator", "if", "the", "patient", "congests", ".", "Eye", "opening", ".", "#ECCMID2019"], "token_idx": 35, "text_start": 216, "text_end": 226, "date": "2019-03"}, "tweet2": {"text": "You're an ICU doctor with 4 patients dying from COVID-19 and need a ventilator. You have one ventilator. Who gets it?", "tokens": ["You're", "an", "ICU", "doctor", "with", "4", "patients", "dying", "from", "COVID", "-", "19", "and", "need", "a", "ventilator", ".", "You", "have", "one", "ventilator", ".", "Who", "gets", "it", "?"], "token_idx": 15, "text_start": 68, "text_end": 78, "date": "2020-03"}}
{"id": "0900-ventilator", "word": "ventilator", "tweet1": {"text": "It's been long I'm on ventilator of Ur memories ...", "tokens": ["It's", "been", "long", "I'm", "on", "ventilator", "of", "Ur", "memories", "..."], "token_idx": 5, "text_start": 22, "text_end": 32, "date": "2019-03"}, "tweet2": {"text": "I was just informed that my baby brother who is Down's Syndrome and has cerebral palsy and is 50 year old, was admitted to ICU with fever and respiratory distress. He is on a ventilator and is being tested for COVID-19. Prayers please. ðŸ¥º", "tokens": ["I", "was", "just", "informed", "that", "my", "baby", "brother", "who", "is", "Down's", "Syndrome", "and", "has", "cerebral", "palsy", "and", "is", "50", "year", "old", ",", "was", "admitted", "to", "ICU", "with", "fever", "and", "respiratory", "distress", ".", "He", "is", "on", "a", "ventilator", "and", "is", "being", "tested", "for", "COVID", "-", "19", ".", "Prayers", "please", ".", "ðŸ¥º"], "token_idx": 36, "text_start": 175, "text_end": 185, "date": "2020-03"}}
{"id": "0901-ventilator", "word": "ventilator", "tweet1": {"text": "Adult son of my patient called at 0200 when he found out his mom is 44 years old in the ICU on a ventilator. No accident. No cancer. â€œShe just has the FLU?!? The F$#*ing FLU?!? Are you kidding me?!?â€ No sir. I'm not. It's not, â€œJust the flu.â€ It kills people. #Vaccinate", "tokens": ["Adult", "son", "of", "my", "patient", "called", "at", "0200", "when", "he", "found", "out", "his", "mom", "is", "44", "years", "old", "in", "the", "ICU", "on", "a", "ventilator", ".", "No", "accident", ".", "No", "cancer", ".", "â€œ", "She", "just", "has", "the", "FLU", "?", "!", "?", "The", "F", "$", "#", "*", "ing", "FLU", "?", "!", "?", "Are", "you", "kidding", "me", "?", "!", "?", "â€", "No", "sir", ".", "I'm", "not", ".", "It's", "not", ",", "â€œ", "Just", "the", "flu", ".", "â€", "It", "kills", "people", ".", "#Vaccinate"], "token_idx": 23, "text_start": 97, "text_end": 107, "date": "2019-03"}, "tweet2": {"text": "#ClapForOurCarers ok I understand why people are clapping for the NHS, but wouldn't it be better instead of clapping to donate Â£1/each (66 Million people) towards NHS so they can get the equipment they need? Clapping is not going to supply a mask or a ventilator.", "tokens": ["#ClapForOurCarers", "ok", "I", "understand", "why", "people", "are", "clapping", "for", "the", "NHS", ",", "but", "wouldn't", "it", "be", "better", "instead", "of", "clapping", "to", "donate", "Â£", "1", "/", "each", "(", "66", "Million", "people", ")", "towards", "NHS", "so", "they", "can", "get", "the", "equipment", "they", "need", "?", "Clapping", "is", "not", "going", "to", "supply", "a", "mask", "or", "a", "ventilator", "."], "token_idx": 52, "text_start": 252, "text_end": 262, "date": "2020-03"}}
{"id": "0902-ventilator", "word": "ventilator", "tweet1": {"text": "Finally up at the hospital visiting my mom. She's awake and off of the ventilator, but she's not herself. Thank you to some of the people who sent me nice messages and prayers. This is one of the hardest things I've had to witness.", "tokens": ["Finally", "up", "at", "the", "hospital", "visiting", "my", "mom", ".", "She's", "awake", "and", "off", "of", "the", "ventilator", ",", "but", "she's", "not", "herself", ".", "Thank", "you", "to", "some", "of", "the", "people", "who", "sent", "me", "nice", "messages", "and", "prayers", ".", "This", "is", "one", "of", "the", "hardest", "things", "I've", "had", "to", "witness", "."], "token_idx": 15, "text_start": 71, "text_end": 81, "date": "2019-03"}, "tweet2": {"text": "The question that nobody asks and the question that I most hate the answer to is what happens if you do have a ventilator? What are your chances? If you do have the ventilator you know the answer to that question. And I hate giving the answer, so I don't want to get â€˜em there.", "tokens": ["The", "question", "that", "nobody", "asks", "and", "the", "question", "that", "I", "most", "hate", "the", "answer", "to", "is", "what", "happens", "if", "you", "do", "have", "a", "ventilator", "?", "What", "are", "your", "chances", "?", "If", "you", "do", "have", "the", "ventilator", "you", "know", "the", "answer", "to", "that", "question", ".", "And", "I", "hate", "giving", "the", "answer", ",", "so", "I", "don't", "want", "to", "get", "â€˜", "em", "there", "."], "token_idx": 23, "text_start": 111, "text_end": 121, "date": "2020-03"}}
{"id": "0903-ventilator", "word": "ventilator", "tweet1": {"text": "Good morning world! Mum is finally off the ventilator. Please pray she sustains so that they can soon relieve her from the Critical Care Unit. It's been far too long and I miss mom and dad at home.", "tokens": ["Good", "morning", "world", "!", "Mum", "is", "finally", "off", "the", "ventilator", ".", "Please", "pray", "she", "sustains", "so", "that", "they", "can", "soon", "relieve", "her", "from", "the", "Critical", "Care", "Unit", ".", "It's", "been", "far", "too", "long", "and", "I", "miss", "mom", "and", "dad", "at", "home", "."], "token_idx": 9, "text_start": 43, "text_end": 53, "date": "2019-03"}, "tweet2": {"text": "Why does the Corona Care Act pay a hospital $13000 for a Covid19 diagnosis and $39000 if you get put on a ventilator Yea...I believe all the numbers reported....Don't You???", "tokens": ["Why", "does", "the", "Corona", "Care", "Act", "pay", "a", "hospital", "$", "13000", "for", "a", "Covid", "19", "diagnosis", "and", "$", "39000", "if", "you", "get", "put", "on", "a", "ventilator", "Yea", "...", "I", "believe", "all", "the", "numbers", "reported", "...", "Don't", "You", "?", "?", "?"], "token_idx": 25, "text_start": 106, "text_end": 116, "date": "2020-03"}}
{"id": "0904-ventilator", "word": "ventilator", "tweet1": {"text": "Other causes of hypotension other than active bleeding in trauma. 1. Hypoxic arrest (resulting cardiac ischaemia) 2. Brain injury 3. Neurogenic shock 4. Cardiac contusion 5. SIRS response 6. Cardiac arrhythmia 7. Peep too high on ventilator 8. Anaphylaxis to roc. Etc #SMACC", "tokens": ["Other", "causes", "of", "hypotension", "other", "than", "active", "bleeding", "in", "trauma", ".", "1", ".", "Hypoxic", "arrest", "(", "resulting", "cardiac", "ischaemia", ")", "2", ".", "Brain", "injury", "3", ".", "Neurogenic", "shock", "4", ".", "Cardiac", "contusion", "5", ".", "SIRS", "response", "6", ".", "Cardiac", "arrhythmia", "7", ".", "Peep", "too", "high", "on", "ventilator", "8", ".", "Anaphylaxis", "to", "roc", ".", "Etc", "#SMACC"], "token_idx": 46, "text_start": 230, "text_end": 240, "date": "2019-03"}, "tweet2": {"text": "Update on Mom aka Alma Mattey: Good News! She's off the ventilator. She's will be recovering and then they will transfer her to physical therapy before sending her home within a week or so.", "tokens": ["Update", "on", "Mom", "aka", "Alma", "Mattey", ":", "Good", "News", "!", "She's", "off", "the", "ventilator", ".", "She's", "will", "be", "recovering", "and", "then", "they", "will", "transfer", "her", "to", "physical", "therapy", "before", "sending", "her", "home", "within", "a", "week", "or", "so", "."], "token_idx": 13, "text_start": 56, "text_end": 66, "date": "2020-03"}}
