{"id": "0927-ventilator", "word": "ventilator", "tweet1": {"text": "Interesting takeaways from \"Headspace\" today. 1. When directed to let my mind do what it wants: it felt like a ping pong ball was let loose in my head at high speed. but no specific thoughts 2. During focused breathing I was reminded of the ventilator dad was on at the end.", "tokens": ["Interesting", "takeaways", "from", "\"", "Headspace", "\"", "today", ".", "1", ".", "When", "directed", "to", "let", "my", "mind", "do", "what", "it", "wants", ":", "it", "felt", "like", "a", "ping", "pong", "ball", "was", "let", "loose", "in", "my", "head", "at", "high", "speed", ".", "but", "no", "specific", "thoughts", "2", ".", "During", "focused", "breathing", "I", "was", "reminded", "of", "the", "ventilator", "dad", "was", "on", "at", "the", "end", "."], "token_idx": 52, "text_start": 241, "text_end": 251, "date": "2019-03"}, "tweet2": {"text": "My step-father's brother-in-law just passed away after a week of being on the ventilator. They took him off and said there was nothing more they could do. Twenty minutes later, his heart stopped. He had heart issues &amp; high BP so COVID attacked him hard. So sad for his family. ðŸ˜¢", "tokens": ["My", "step-father's", "brother-in-law", "just", "passed", "away", "after", "a", "week", "of", "being", "on", "the", "ventilator", ".", "They", "took", "him", "off", "and", "said", "there", "was", "nothing", "more", "they", "could", "do", ".", "Twenty", "minutes", "later", ",", "his", "heart", "stopped", ".", "He", "had", "heart", "issues", "&", "high", "BP", "so", "COVID", "attacked", "him", "hard", ".", "So", "sad", "for", "his", "family", ".", "ðŸ˜¢"], "token_idx": 13, "text_start": 78, "text_end": 88, "date": "2020-03"}}
