{"id": "2511-teargas", "word": "teargas", "tweet1": {"text": "So there was two different protests in Lagos today, one group received teargas and live bullets (allegedly) from policemen while the other group of protesters received utmost police protection. This govt is a huge joke.", "tokens": ["So", "there", "was", "two", "different", "protests", "in", "Lagos", "today", ",", "one", "group", "received", "teargas", "and", "live", "bullets", "(", "allegedly", ")", "from", "policemen", "while", "the", "other", "group", "of", "protesters", "received", "utmost", "police", "protection", ".", "This", "govt", "is", "a", "huge", "joke", "."], "token_idx": 13, "text_start": 71, "text_end": 78, "date": "2019-07"}, "tweet2": {"text": "One of my biggest problems with teargas is how indescriminant it is. Another is that it's toxic.", "tokens": ["One", "of", "my", "biggest", "problems", "with", "teargas", "is", "how", "indescriminant", "it", "is", ".", "Another", "is", "that", "it's", "toxic", "."], "token_idx": 6, "text_start": 32, "text_end": 39, "date": "2020-07"}}
