{"id": "2514-teargas", "word": "teargas", "tweet1": {"text": "A Cool Jape would be to replace all the police's teargas with nitrous oxide. The next time they go out to try and corral some civil unrest will be a real laugh riot.", "tokens": ["A", "Cool", "Jape", "would", "be", "to", "replace", "all", "the", "police's", "teargas", "with", "nitrous", "oxide", ".", "The", "next", "time", "they", "go", "out", "to", "try", "and", "corral", "some", "civil", "unrest", "will", "be", "a", "real", "laugh", "riot", "."], "token_idx": 10, "text_start": 49, "text_end": 56, "date": "2019-07"}, "tweet2": {"text": "Last nights teargas was unbearable and completely disorienting. I don't know what kind of teargas that was but it was scary. I couldn't breathe and I couldn't see and my whole face burnt. Somehow I made it through the park with some help and there we're people with eyewash. Scary", "tokens": ["Last", "nights", "teargas", "was", "unbearable", "and", "completely", "disorienting", ".", "I", "don't", "know", "what", "kind", "of", "teargas", "that", "was", "but", "it", "was", "scary", ".", "I", "couldn't", "breathe", "and", "I", "couldn't", "see", "and", "my", "whole", "face", "burnt", ".", "Somehow", "I", "made", "it", "through", "the", "park", "with", "some", "help", "and", "there", "we're", "people", "with", "eyewash", ".", "Scary"], "token_idx": 2, "text_start": 12, "text_end": 19, "date": "2020-07"}}
