{"id": "2521-teargas", "word": "teargas", "tweet1": {"text": "When the teargas got to me &amp; it was too much. This old security guard came &amp; pulled me over, he took me to building, pulled a chair for me. Made me sit there until it was safe. I am thankful for that security guard. #16AugustDemo #Zimbabwe", "tokens": ["When", "the", "teargas", "got", "to", "me", "&", "it", "was", "too", "much", ".", "This", "old", "security", "guard", "came", "&", "pulled", "me", "over", ",", "he", "took", "me", "to", "building", ",", "pulled", "a", "chair", "for", "me", ".", "Made", "me", "sit", "there", "until", "it", "was", "safe", ".", "I", "am", "thankful", "for", "that", "security", "guard", ".", "#16AugustDemo", "#Zimbabwe"], "token_idx": 2, "text_start": 9, "text_end": 16, "date": "2019-07"}, "tweet2": {"text": "Please I'll like to know if @MBuhari has honoured the memory of Dr Chuba Okadigbo his running mate who died as a result of the teargas by the Police during his protest alongside Buhari in Kano or done anything for the Okadigbos in respect to their father?", "tokens": ["Please", "I'll", "like", "to", "know", "if", "@MBuhari", "has", "honoured", "the", "memory", "of", "Dr", "Chuba", "Okadigbo", "his", "running", "mate", "who", "died", "as", "a", "result", "of", "the", "teargas", "by", "the", "Police", "during", "his", "protest", "alongside", "Buhari", "in", "Kano", "or", "done", "anything", "for", "the", "Okadigbos", "in", "respect", "to", "their", "father", "?"], "token_idx": 25, "text_start": 127, "text_end": 134, "date": "2020-07"}}
{"id": "2522-teargas", "word": "teargas", "tweet1": {"text": "At least 7 of the more than 200 Palestinians killed in the Great March of Return Protests in Gaza died as a result of a direct teargas canister hit, according to @btselem @ochaopt", "tokens": ["At", "least", "7", "of", "the", "more", "than", "200", "Palestinians", "killed", "in", "the", "Great", "March", "of", "Return", "Protests", "in", "Gaza", "died", "as", "a", "result", "of", "a", "direct", "teargas", "canister", "hit", ",", "according", "to", "@btselem", "@ochaopt"], "token_idx": 26, "text_start": 127, "text_end": 134, "date": "2019-07"}, "tweet2": {"text": "When do they run out of teargas?", "tokens": ["When", "do", "they", "run", "out", "of", "teargas", "?"], "token_idx": 6, "text_start": 24, "text_end": 31, "date": "2020-07"}}
{"id": "2523-teargas", "word": "teargas", "tweet1": {"text": "Someone has fed us with teargas along Harambee Avenue.. it's been long kumbe ilikuwa hivi ðŸ˜­ðŸ˜­", "tokens": ["Someone", "has", "fed", "us", "with", "teargas", "along", "Harambee", "Avenue", "..", "it's", "been", "long", "kumbe", "ilikuwa", "hivi", "ðŸ˜­", "ðŸ˜­"], "token_idx": 5, "text_start": 24, "text_end": 31, "date": "2019-07"}, "tweet2": {"text": "In a separate video showing the damaged windshield, Maryam said that the police was firing teargas at her convoy. She added that police were pelting stones and shelling outside NAB's office to disperse the PML-N workers who had gathered outside. #ØªØ®ØªÛŒ_Ú†ÙˆØ±_ÙˆØ²ÛŒØ±Ø§Ø¹Ø¸Ù… 152", "tokens": ["In", "a", "separate", "video", "showing", "the", "damaged", "windshield", ",", "Maryam", "said", "that", "the", "police", "was", "firing", "teargas", "at", "her", "convoy", ".", "She", "added", "that", "police", "were", "pelting", "stones", "and", "shelling", "outside", "NAB's", "office", "to", "disperse", "the", "PML-N", "workers", "who", "had", "gathered", "outside", ".", "#ØªØ®ØªÛŒ_Ú†ÙˆØ±_ÙˆØ²ÛŒØ±Ø§Ø¹Ø¸Ù…", "152"], "token_idx": 16, "text_start": 91, "text_end": 98, "date": "2020-07"}}
