{"id": "3763-paternity", "word": "paternity", "tweet1": {"text": "Should've kept Haseley up, used him as the CF and Alternated Dickerson and Bruce in LF. Used Quinn as the PH and late game defense replacement ala micheal bourn. Plus isn't Bryce going out soon for paternity leave? ðŸ¤”", "tokens": ["Should've", "kept", "Haseley", "up", ",", "used", "him", "as", "the", "CF", "and", "Alternated", "Dickerson", "and", "Bruce", "in", "LF", ".", "Used", "Quinn", "as", "the", "PH", "and", "late", "game", "defense", "replacement", "ala", "micheal", "bourn", ".", "Plus", "isn't", "Bryce", "going", "out", "soon", "for", "paternity", "leave", "?", "ðŸ¤”"], "token_idx": 39, "text_start": 198, "text_end": 207, "date": "2019-07"}, "tweet2": {"text": "And I'm not talking about the â€œtruthâ€ of a political position. Or the truth of a decision between two options. I'm talking about the truth of brotherhood and sisterhood. Of intimacy. Of paternity and maternity. Let that truth guide you.", "tokens": ["And", "I'm", "not", "talking", "about", "the", "â€œ", "truth", "â€", "of", "a", "political", "position", ".", "Or", "the", "truth", "of", "a", "decision", "between", "two", "options", ".", "I'm", "talking", "about", "the", "truth", "of", "brotherhood", "and", "sisterhood", ".", "Of", "intimacy", ".", "Of", "paternity", "and", "maternity", ".", "Let", "that", "truth", "guide", "you", "."], "token_idx": 38, "text_start": 186, "text_end": 195, "date": "2020-07"}}
